import React from 'react';
import { StyleSheet, Text, Image, TouchableOpacity, View } from 'react-native';
const Calling = (props) => {
   
    return(
        <View>
        <View style={styles.container}>
            <Text> Calling for a friend</Text>
            </View>
   </View>
    )
}
const styles = StyleSheet.create({
    container:{
        backgroundColor:'#fff',
        width:120,
        margin:10,
        padding:10,
        flexDirection:'row',
        justifyContent: 'space-between',
        alignItems:'center',
        borderRadius:10,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.25,
        shadowRadius: 4.84,

        elevation: 5,
    },

});

export default Calling
